    Navarre Division are included. The Plan provides an introduction and history of
    the refuges, information about program relation to refuge objectives, program policies,
    a description of the program, a list of program units, and use requirements. The
    effect of the fishing program on waterfowl habitat is discussed. A fact sheet for
